import React from 'react';
import Footer from '../Footer/Footer';
import NavBar from '../Navbar/NavBar';
import { TextField , DatePicker } from '@mui/material';
import { makeStyles, multiTextField } from '@mui/styles';
import './SignUp.css'
import { createTheme, ThemeProvider } from '@mui/material/styles';
import Button from '@mui/material/Button';
// import { createTheme, ThemeProvider } from '@mui/material/styles';
// import { purple } from '@mui/material/colors';

// const Mytheme = createTheme(
//     {
//         shape:{
//             borderRadius: 10
//         }
//     }
// )


const useStyles = makeStyles({
    field: {
        marginBlock: '20px',
        width: '250px',
        borderRadius: '10px',
        fontSize: 14
    }
})

function SignUp() {

    const classes = useStyles()



   return(
       <>
           <NavBar/>
           <div className="signup">

               <div className="signupHeader">
                   <div className="backarrow">
                       <img src="https://res.cloudinary.com/do5wu6ikf/image/upload/v1684452441/starpenzu/back_qpybto.svg" alt=""/>
                   </div>

                   <div className="signupTitle">
                       Register
                   </div>
               </div>
                {/*<ThemeProvider theme={Mytheme}>*/}
               <form action="" noValidate={true} className="register">
                   <TextField
                       className={classes.field}
                       id="outlined-basic"
                       label="First Name"
                       color='secondary'
                       variant="outlined"
                       margin="dense"
                       type='text'
                       gutterBottom ={true}
                       required
                   />
                   {/*<DatePicker sx={{ color: 'red' }/>*/}
                   <TextField
                       className={classes.field}
                       id="outlined-basic"
                       label="Password"
                       color='secondary'
                       variant="outlined"
                       margin="dense"
                       type='password'
                       required
                   />
                     <TextField
                       className={classes.field}
                       id="outlined-basic"
                       label="Date of Birth"
                       color='secondary'
                       format=""
                       margin="dense"
                       variant="outlined"
                       type='date'
                   />
                     <TextField
                       className={classes.field}
                       id="outlined-basic"
                       label="Gender"
                       color='secondary'
                       margin="dense"
                       variant="outlined"
                       type='text'
                   />

               </form>
                {/*</ThemeProvider>*/}



           </div>

           <Footer/>
       </>

   )
}

export default SignUp;
